import React from "react";
import Card from "../../componants/card/Card";
import styles from "../../style/common/card.module.css";
import Title from "../../componants/common/Title";

function Hoodies() {
  const data = [
    {
      src: "/toy-images/01.png",
      title: "SANATANI Hoodie (Black)",
      desc: "₹1,499.00.",
    },
    {
      src: "/toy-images/02.png",
      title: "Haters slogan hoodie- Olive green",
      desc: "₹1,799.00",
    },
    {
      src: "/toy-images/03.png",
      title: "“Haters”- Slogan Hoodie (Light Green)",
      desc: "₹1,799.00",
    },
    {
      src: "/toy-images/04.png",
      title: "TYPO HOODIE- RED",
      desc: "₹1,799.00",
    },
    {
      src: "/toy-images/05.png",
      title: "SHREE RAM – Hoodie",
      desc: "₹1,799.00",
    },
    {
      src: "/toy-images/06.png",
      title: "BAD-MOSS (Grey)",
      desc: "₹1,499.00",
    },
    {
      src: "/toy-images/07.png",
      title: "SYSTUMM TYPO- Hoodie (Green)",
      desc: "₹1,799.00",
    },
    {
      src: "/toy-images/08.png",
      title: "Chore Haryana Aale – Purple",
      desc: "₹1,799.00",
    },
  ];

  return (
    <>
      <Title title="MARVEL TOYS" />
      <div className={styles.map1}>
        {data.map((value, index) => {
          return (
            <Card
              key={index}
              src={value.src}
              title={value.title}
              desc={value.desc}
            />
          );
        })}
      </div>
    </>
  );
}

export default Hoodies;
